INSERT INTO `hr_letters` (`id`, `staff_id`, `user_id`, `org_id`, `type`, `subject`, `body`, `template`, `status`, `enabled`, `created_at`, `updated_at`) VALUES
(1, 0, NULL, 1, 'contract', 'Salary Certificate for Kripa Thapa', '<p>To WHOM IT MAY CONCERN</p>\r\n<p>Nov.5. 2019</p>\r\n<p>This is to certify that&nbsp; Mrs.&nbsp;Kripa Thapa (Employee #29) is working with our esteem company under the title of Marketing Consultant. We found her fully committed to her job and totally sincere toward this company. She is drawing gross salary of 996000 ( In words nine lakhs ninety six thousand only).</p>\r\n<p>&nbsp;</p>\r\n<p>We are issuing this letter on the specific request of our employee without accepting any liability on behalf of this letter or part of this letter in our company.</p>\r\n<p>&nbsp;</p>\r\n<p>Regards<br />Manida Shahi<br />Finance Controller</p>\r\n<div>\r\n<h2>&nbsp;</h2>\r\n</div>', 'contract', 'finalized', 1, '2019-11-05 04:40:09', '2019-11-05 10:25:09'),
(2, 52, 2, 1, 'contract', 'test', '<p>From:</p><p>Amita Avasthi</p><p>HR Manager</p><p>KYK Technologies Pvt. Ltd.</p><p>New Delhi</p><p>Date: January 1st, 2020</p><p>To,</p><p>Shiva Khadka</p><p>54, Karol Bagh</p><p>New Delhi</p><p>Dear Mr. Sharma,</p><p>You have always been an asset to KYK Technologies Pvt. Ltd. In the association of 12 long years, you have served the company with utmost dedication and hard work. As you are aware that on completing the age of 65 years, employees are superannuated as per the Superannuation Policy of the Company. Since you are going to attain the age of 65 years as on January 25th, 2020 and you will be superannuated on February 1st, 2020. But because you are an inspiring and committed employee, the Company would appreciate if you could work with us for another year.</p><p>There are many projects going in which you have a significant role to play and we would love to have you with us until these projects get completed. But this is possible only if we mutually agree on it. We request you to kindly submit your consent in response to this letter with the HR Department so that we can take care of the proceedings.</p><p>Looking forward to hear from you.</p><p>Sincerely,</p><p>Amita Avasthi</p><p>HR Manager</p><p>KYK Technologies Pvt. Ltd.</p>', '5', 'draft', 1, '2020-08-23 12:51:30', '2020-08-23 12:51:30');
INSERT INTO `hr_letter_templates` (`id`, `name`, `description`, `user_id`, `org_id`, `created_at`, `updated_at`) VALUES
(5, 'Service Extension Letter after Retirement', '<p>From:</p><p>Amita Avasthi</p><p>HR Manager</p><p>KYK Technologies Pvt. Ltd.</p><p>New Delhi</p><p>Date: January 1st, 2020</p><p>To,</p><p>{{first_name}} {{last_name}}</p><p>54, Karol Bagh</p><p>New Delhi</p><p>Dear Mr. Sharma,</p><p>You have always been an asset to KYK Technologies Pvt. Ltd. In the association of 12 long years, you have served the company with utmost dedication and hard work. As you are aware that on completing the age of 65 years, employees are superannuated as per the Superannuation Policy of the Company. Since you are going to attain the age of 65 years as on January 25th, 2020 and you will be superannuated on February 1st, 2020. But because you are an inspiring and committed employee, the Company would appreciate if you could work with us for another year.</p><p>There are many projects going in which you have a significant role to play and we would love to have you with us until these projects get completed. But this is possible only if we mutually agree on it. We request you to kindly submit your consent in response to this letter with the HR Department so that we can take care of the proceedings.</p><p>Looking forward to hear from you.</p><p>Sincerely,</p><p>Amita Avasthi</p><p>HR Manager</p><p>KYK Technologies Pvt. Ltd.</p>', 2, 1, '2020-08-23 07:01:32', '2020-08-23 12:46:32'),
(6, 'Job Offer Email', '<p>\r\n\r\n</p><p>Dear {{first_name}},</p><p>XYZ Inc. is pleased to offer you the position of Executive Assistant.</p><p>Your start date will be June 1, 2020. I’ve attached our welcome package, which outlines your salary and benefits as well as our policies and procedures. Please confirm receipt of this email and your acceptance of our terms.</p><p>Please feel free to contact me with any questions. We’re excited to welcome you to the team!</p><p>Sincerely,</p><p>Ellen Smith<br>Human Resources<br>XYZ Inc.</p>\r\n\r\n<br><p></p>', 2, 1, '2020-08-23 07:17:03', '2020-08-23 13:02:03'),
(7, 'New Employee welcome letter', '{{first_name}} {{last_name}}\r\n123 Business Rd.\r\nBusiness City, NY 54321\r\n123 Main Street,\r\nAnytown, CA 12345\r\n\r\nDear Ms. Jones,\r\n\r\nWe’re writing to welcome you to Acme Industries and to tell you how much we are looking forward to you joining our team. You bring experience, knowledge, and skills that enhance our capabilities.\r\n\r\nWe’re expecting you for new employee orientation on September 15 at 9 a.m. You will meet with me to discuss your successful integration into our company and with Human Resources staff to learn about employment related issues. Our dress code is business casual.\r\n\r\nYour new team anticipates taking you out to lunch to get to know you and to make sure you meet everyone with whom you will be working. Your agenda, for the rest of your first day, follows.\r\n\r\nNew Employee Agenda\r\n9 a.m. Meet with me to detail your orientation plan and add your interests. Introduce you to your workstation and tools.\r\n10 a.m. Meet with Human Resources to review employment information and policies.\r\n12-1:30 p.m. Lunch with your new coworkers and me. The objective is welcome and meet the team.\r\n1:30-2:30 p.m. Review your job description with me and set initial goals for orientation, learning, and contribution.\r\n2:30 – 5 p.m. Meet with each of the coworkers, with whom you must work most closely to begin to understand how your jobs overlap and how you can support each other.\r\n\r\nI anticipate that your second day will involve more coworker meetings to understand the department. You’ll also have the opportunity to continue with your new employee orientation plan and your initial work for the department.\r\n\r\nAgain, welcome to the team. If you have questions, please call me at any time. We look forward to working with you.\r\n\r\nSincerely,\r\n\r\n\r\nCallie Lee', 2, 1, '2020-08-23 13:04:45', '2020-08-23 13:04:45');
